import React, { Component } from 'react';
import Item1 from '../images/item1.JPG'
class Post extends Component {
    render() {
        return (

            <div className="card flex-md-row mr-4 box-shadow h-md-250">
            <div className="card-body d-flex flex-column align-items-start">
              <strong className="d-inline-block text-primary">{this.props.category}</strong>
              <h3 className="mr-5">
                <a className="text-dark" href="#">{this.props.title}</a>
              </h3>
              <div className="text-muted mr-5">{this.props.date}</div>
              <p className="card-text mb-auto mr-5">{this.props.shortDesc}</p>
              <a href="#">Continue reading</a>
            </div>
            <img className="card-img-right flex-auto d-none d-md-block" src={Item1}/>
          </div>
        );
    }
}

export default Post;
